import axios from "axios";
import setAuthToken from "../utils/setAuthToken";
import jwt_decode from "jwt-decode";
import { GET_ERRORS, VISUALIZZA_PRENOTAZIONI } from "./type";

//Register Prenotazioni
export const registerPrenotazione = (prenotazione) => (dispatch) => {
  axios
    .post("api/prenotazioni/addPrenotazione", prenotazione)
    .then((res) => (window.location.href = "/RiepilogoPrenotazione"))
    .catch((err) =>
      dispatch({
        type: GET_ERRORS,
        payload: err.response.data,
      })
    );
};

export const ListaPrenotazioni = () => (dispatch) => {
  axios.get("/api/prenotazioni/prenotazionilist");
  console
    .log("sono qui")
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: VISUALIZZA_PRENOTAZIONI,
        payload: res.data,
      });
    })
    .catch((err) => console.error(err));
};
